import { SET_ERRORS, CLEAR_ERRORS, LOADING } from '../types'

const initialState = {
    loading: false,
    errors: null
}

export default function(state = initialState, action) {
    switch(action.types) {
        case SET_ERRORS:
            return {
                ...state,

            }
        default:
            return state;
    }
}
